import React from 'react';
import {Component} from 'react';
import Pictures from "./Pictures"
import Something from "./Something"
import './App.css';
import { entries } from './EntriesData.js'

import YourComponent from "./Something.js";

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
const Nav = () => (
  <div>
         <Link to="/Something.js" className="btn btn-primary">hello</Link>
         <Something />
  </div>
);

class App extends Component {
  constructor() {
    super();
    this.state = {
      entries: entries
    }
  }
  componentDidMount(){

    var self = this;
    // self.setState({
    //   entries: entries
    // });
  }
  render(){
    return (
          <Router>
          <div>

            <ul>
              <li>
                <Link to="/public">Public Page</Link>
              </li>
              <li>
                <Link to="/protected">Protected Page</Link>
              </li>
            </ul>

            <Switch>
              <Route path="/public">
                <PublicPage />
              </Route>
              <Route path="/protected">
                <ProtectedPage />
              </Route>
            </Switch>
          </div>
        </Router>
    );
  }
}
export default App;
